import React, { useState } from 'react';
function Event() {
    return(
        <li className="eventItem">

        </li>
    );
}

function Events() {
    var userEvent = '';
    var search = '';

    const addEvent = async event =>
    {
        event.preventDefault();

        alert('addEvent()');
    };

    const searchEvent = async event =>
    {
        event.preventDefault();

        alert('searchEvent');
    };

    return(
        <div className="myEvents">
            <h1 id="eventsHeader">My Events</h1>
            <div id="postContainer">
                <input type="text" id="searchText" placeholder="Search Event" />
                <button type="button" id="searchButton" onClick={searchEvent}>Search</button> <br />
                <span id="eventSearchResult"></span>
                <br />
                <input type="text" id="addText" placeholder="Add Event" />
                <button type="button" id="postButton" onClick={addEvent}>Post</button> <br />
                <span id="eventAddResult"></span>
            </div>
        </div>
    );
}

function TopBar() {
    return(
        <div class="topBar">
            <div class="linkContainer">
                <a className="topBarLink" id="homeLink">Home</a>
                <a className="topBarLink" id="calendarLink">Calendar</a>
            </div>
        </div>
    );
}

function HomePage() {
    return(
        <div>
            <TopBar />
            <Events />
        </div>
    );
};

function Home()
{
    return(
        <div className="HomePage">
            <HomePage />
        </div>
    );
};

export default Home;
